@Override
protected boolean lessThan(TermsEnumWithSlice termsA, TermsEnumWithSlice termsB) {
  final int cmp = termComp.compare(termsA.current, termsB.current);
  if (cmp != 0) {
    return cmp < 0;
  } else {
    return termsA.subSlice.start < termsB.subSlice.start;
  }
}

